import React from "react";
import Room from "./Room";
import info from "../info"


function createRoom(info) {
    return (
      <Room
        key={info.id}
        roomId = {info.id}
        temp={info.temp}
        hub={info.hub}
        last_active={info.last_active}
      />
    );
   }


function App() {
 return (
   <div className="info">
     <h1 className="heading">Petaluma</h1>
     {info.map(createRoom)}
   </div> );}
export default App;
